import hashlib
import pickle


def check_word(MD5, word, salt_left, salt_right, HASH_SIZE, bitmask):
    MD5 = hashlib.md5()
    for l, r in zip(salt_left, salt_right):
        MD5.update((l + word + r).encode(encoding='ascii'))
        a = int(MD5.hexdigest(), 16)
        a = a % HASH_SIZE
        if bitmask[a] == 0:
            return False
    return True


def oracle(word):
    try:
        prefix = oracle.prefix
        postfix = oracle.postfix
        bm = oracle.bm
        MD5 = hashlib.md5()
    except AttributeError:
        with open('./record', 'rb') as w:
            prefix, postfix, bm = pickle.load(w)
            oracle.prefix = prefix
            oracle.postfix = postfix
            oracle.bm = bm
            oracle.MD5 = hashlib.md5()
            MD5 = oracle.MD5

    return check_word(MD5, word, prefix, postfix, len(bm), bm)


